import {React, useState, useMemo} from 'react'
import { FlexCol, PaddingX, Padding, FlexRow } from '../constants/style'
import { Fade, Slide } from 'react-reveal';
import { useNavigate } from 'react-router-dom';
import Pulse from 'react-reveal/Pulse';
import Bell from '../assets/images/Bell.png';
import Enlarge from '../assets/images/Enlarge.png';
import dummy from '../data/menu.json';
import { useTable, Table, Thead, Tbody, Tr, Th, Td } from 'react-table';



export default function Order() {
  const navigate = useNavigate();

  const handleOrderClick = () => {
    navigate('/');
  };


  const columns = useMemo(
    () => [
      {
        accessor: "떡볶이류",
        Header: "떡볶이류",
      },
      {
        accessor: "세트메뉴",
        Header: "세트메뉴",
      },
      {
        accessor: "사이드류",
        Header: "사이드류",
      },
    ], []
  );

  // const data = useMemo(
  //   () => [
  //     {
  //       "menu" : "진짜떡볶이",
  //       "price" : 3000,
  //       "count" : 0,
  //     },
  //     {
  //       "menu" : "치즈떡볶이",
  //       "price" : 4000,
  //       "count" : 0,
  //     },
  //   ], []
  // );

  const data = useMemo(() => [{
    "email": "이메일이에용",
    "walletID": "아이디에용",
    "created_at": "2021-08-03 01:14:47",
    "edited_at": "2021-08-03 01:15:49",
    "coin_list": ["TRV", "BTC", "BCH", "ETH"]
  }], [])

  
  const {
    getTableProps, 
    getTableBodyProps, 
    headerGroups, 
    rows, 
    prepareRow } = useTable({ columns, data });

  return (
    <div className={`${FlexCol} bg-beige relative z-0 h-screen`}>
      <Fade>
      <div className={`${FlexRow} m-10`}>
        <img src='/images/logo.png' className={`w-1/4`}/>
        <button className={`w-[150px] h-[170px] justify-center flex absolute right-10 top-10`}>
          {/* 직원 호출하면 dialog 띄우기 */}
          <img src={Bell} className={`w-[150px] h-[170px]`}/> 
        </button>
      </div>
      
      <div className={`bg-darkbrown rounded-full text-center ml-12 mr-12 mt-12 pt-4 pb-2`}>
        <p className={`font-Gmarket text-white text-[40px]`}>+버튼과 -버튼으로 수량을 정해보세요</p>
      </div>

    
      <table {...getTableProps()} className={`w-1/2`}>
        <thead className={`bg-darkred text-Jeju text-white text-2xl`}>
          {headerGroups.map((headerGroup) => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map((column) => (
                <th {...column.getHeaderProps()}>{column.render("Header")}</th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()} className={`bg-white text-Jeju text-2xl`}>
          {rows.map((row) => {
            prepareRow(row);
            return (
              <tr {...row.getRowProps()}>
                {row.cells.map((cell) => {
                  <td {...cell.getCellProps()}>{cell.render("Cell")}</td>;
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
  


      <div className={`bg-white rounded-tl-full rounded-tr-full rounded-br-full text-center mt-12 ml-12 mr-12 pt-4 pb-2`}>
        {/* 가격 비동기적으로 변하게 하기 */}
        <p className={`font-Jeju text-[40px]`}>총 16700원입니다. 결제하시겠습니까?</p>
      </div>

      <div className={`${FlexRow} justify-center mt-20`}>
        <button 
          className={`bg-red w-2/5 h-[200px] rounded-[30px] pt-8`}
          onClick={handleOrderClick}>
            {/* 팝업창 띄우기 */}
            <p className={'font-Gangwon text-[80px] text-white'}>결제하기</p>
        </button>
        <button className={`w-[150px] justify-center absolute right-12`}>
          <img src={Enlarge}/>
        </button>
      </div>
      
    </Fade>
    </div>
  )
}
